INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (402, 'Cheese, mozzarella', 289.91, 22.2, 22.1, 0, 0, 0, 0, 522, 68.8, 24.9, 2.5, 3.2, 71, 'Cheese, hard cheese ripened styles', 'Cheese made from cows milk with a rubbery texture. Typically added to pizza and other Italian-style dishes.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (403, 'Cheese, parmesan, dried, finely grated', 465.82, 40.6, 33.3, 0, 0, 0, 0, 1300, 66.9, 30.3, 3, 3.1, 88, 'Cheese, hard cheese ripened styles', 'Parmesan-style cheese, prepared by removing the majority of cream from cows milk before heating, curdling and brining. Cheese is finely grated prior to sale and some additional moisture may be removed, so that the cheese does not generally require refrigerator storage.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (404, 'Cheese, parmesan, fresh', 403.92, 35.1, 28.8, 0, 0, 0, 0, 1300, 66.9, 30.3, 3.54, 3.1, 77, 'Cheese, hard cheese ripened styles', 'A hard granular cheese prepared by removing the majority of cream from cows milk before heating, curdling and brining. Cheese is shaved or coarsely grated prior to sale so that it is moister than finely grated parmesan cheese and requires refrigerator storage.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (405, 'Cheese, ricotta', 158.94, 10.4, 11.8, 0, 0, 2.7, 2.7, 170, 69.3, 24.8, 2.52, 2.1, 50, 'Cheese, unripened styles, including cream and cottage cheese, regular fat', 'Australian produced ricotta cheese. Prepared by collecting the whey from the coagulation of cows milk and further separation and draining.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (406, 'Cheese, soy', 294.93, 7, 28, 0.6, 0, 1.8, 4.7, 685, 14.3, 24.4, 60.6, 2, 0, 'Cheese substitute', 'Cheese substitute produced using soy bean curd and other ingredients such as salt and thickeners. Includes hard and ''cream cheese'' varieties.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (407, 'Cream, thickened, regular fat (approximately 35%)', 336.76, 2, 36.1, 0, 0, 2.4, 2.4, 27, 68.25, 25.5, 3.99, 5.5, 110, 'Cream, regular and increased fat', 'Australian produced thickened cream with a fat content of 35%. Major ingredients include cream, gelatine and vegetable gum. Produced by separating milk into a highly concentrated milk fat stream (cream) and a non-milk fat stream (skim milk) and adding thickener to increase the viscosity.');
INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (408, 'Cream, imitation (non-dairy)', 264.82, 1, 21.8, 0, 0, 16.3, 17.7, 57, 94.2, 5.3, 0.4, 1.5, 0, 'Cream substitute, artificial cream ', 'Commercially produced soft product with a creamy appearance and texture that is commonly used in baked goods in place of whipped dairy cream, but which is not dairy-based.');
