INSERT INTO  foods (food_id, food_name, food_total_calories, food_protein, food_total_fat, food_total_dietary_fibre, food_alcohol, food_sugars, food_carbohydrates, food_sodium, food_saturated_fatty_acids, food_monounsaturated_fatty_acids, food_polyunsaturated_fatty_acids, food_trans_fatty_acids, food_cholesterol, food_categories, food_description) VALUES (411, 'Ice cream, vanilla flavour, regular fat', 188.34, 3.7, 10.6, 0, 0, 18.4, 20.5, 48, 71.5, 25, 2.8, 3.1, 35, 'Ice cream, tub varieties, fat content >10 g/100 g', 'Commercial product prepared by mixing milk, sugar, gums, emulsifiers and vanilla flavour, then freezing rapidly with agitation to aerate the ice cream to give it a light texture. Includes varieties with a fat content of 11%. Some analysed samples contain egg yolk.');
